import { Formik } from "formik";
import React from "react";

function Login2() {
  let array = [];
  return (
    <Formik
      initialValues={{
        usuario: "",
        password: "",
      }}
      validate={(valores) => {
        let errores = {};
        if (!valores.usuario) {
          errores.usuario = "Por favor ingresa un usuario";
        } else if (!valores.password) {
          errores.password = "Por favor ingresa un usuario";
        }
        return errores;
      }}
      onSubmit={(valores) => {
        console.log(valores);
        array.push(valores);
      }}
    >
      {({ values, errors, handleSubmit, handleChange, handleBlur }) => (
        <form onSubmit={handleSubmit}>
          <div>
            <label htmlFor="usuario">Usuario</label>
            <input
              type="text"
              id="usuario"
              name="usuario"
              placeholder="username"
              value={values.usuario}
              onChange={handleChange}
              onBlur={handleBlur}
            />
            {errors.usuario && <div>{errors.usuario}</div>}
          </div>
          <div>
            <label htmlFor="password">Contrase√±a</label>
            <input
              type="password"
              id="password"
              name="password"
              placeholder="password"
              value={values.password}
              onChange={handleChange}
              onBlur={handleBlur}
            />
          </div>
          <button type="submit">Login</button>
          {console.log(array)}
        </form>
      )}
    </Formik>
  );
}

export default Login2;
